        cin >> t;
        while(t--) {
            int n;
            cin >> n;
            vector<int> v(n);
            for(int i = 0; i < n; i++) {
                cin >> v[i];
            }
            sort(v.begin(), v.end());
            v.resize(unique(v.begin(), v.end()) - v.begin());
