int n, k; 
vi a; 

bool isPos(int mid){
    
    int sum = 0, grps = 1;
    
    for(int i = 0; i<n; i++){
        
        if(sum + a[i] > mid){
            sum = 0; grps++;
        }
        sum += a[i];
    }
    
    return grps <= k; 
    
}

void solve(){
    
    cin>>n>>k;
    
    a.resize(n); inp(a);
    
    int l = maxEle(a), h = sumAll(a);
    int ans = 0;
    
    while(l<=h){
        
        int mid = ( l + h ) >> 1;
        
        if(isPos(mid)){
            ans = mid; 
            h = mid - 1;
        }
        else{
            
            l = mid + 1;
        }
        
        
    }
    
    cout<<ans<<"\n";
    
}



