int lcm(int a, int b)
{
    return (a * b) / (__gcd(a, b));
}

int fun(int n, int a, int b, int c)
{
    int ans = (n / a) + (n / b) + (n / c);
    ans -= (n / lcm(a , b));
    ans -= (n / lcm(b , c));
    ans -= (n / lcm(c , a));
    ans += (n / lcm(a , lcm(b , c)));

    return ans;
}

void solve()
{
    int n, a, b, c;
    cin >> n >> a >> b >> c;

    int l = 1, h = LLONG_MAX;
    int ans = -1;
    while(l <= h)
    {
        int m = (l + h) >> 1;
        int x = fun(m, a, b, c);
        if(x >= n)
        {
            ans = m;
            h = m - 1;
        }
        else 
        {
            l = m + 1;
        }
    }
    println(ans);
}

