bool cmp(pii &p1, pii &p2)
{
    if(p1.F == p2.F)
    {
        return p1.S > p2.S;
    }
    return p1.F > p2.F;
}

void solve()
{
    int n, k;
    cin >> n >> k;

    vpi points;
    f(i, 0, n)
    {
        int a, b;
        cin >> a >> b;
        points.pb({b, a});
    }
    sort(all(points), cmp);
    int ans = 0;
    int i = 0;
    debug(points);
    while(k > 0)
    {
        if(points[i].S <= k)
        {
            ans += points[i].F * points[i].S;
            k -= points[i].S; 
            i++;
        }
        else 
        {
            ans += k * points[i].F;
            break;
        }
    }

    println(ans);
}

