# Annoying ass questions. Just use a Trie
# TC: O(N) where N is number of nodes in trie, that's the worst case scenario
# SC: O(N)

class TrieNode:
    def __init__(self):
        self.content = ""
        self.children = defaultdict(TrieNode)
        self.isfile = False

class FileSystem:

    def __init__(self):
        self.head = TrieNode()

    def ls(self, path: str) -> List[str]:
        path_list = [p for p in path.split('/') if p]
        node = self.head
        for p in path_list:
            if p not in node.children:
                return f'{path} does not exist!'
            node = node.children.get(p)

        results = [p] if node.isfile else sorted([k for k, v in node.children.items()])
        return results


    def mkdir(self, path: str) -> None:
        path_list = [p for p in path.split('/') if p]
        node = self.head
        for p in path_list:
            node = node.children[p]


    def addContentToFile(self, filePath: str, content: str) -> None:
        path_list = [p for p in filePath.split('/') if p]
        node = self.head
        for p in path_list:
            node = node.children[p]

        node.content += content
        node.isfile = True


    def readContentFromFile(self, filePath: str) -> str:
        path_list = [p for p in filePath.split('/') if p]
        node = self.head
        for p in path_list:
            if p not in node.children:
                return f'File {filePath} not found!'
            node = node.children[p]

        if not node.isfile:
            raise Error(f'{filePath} is not a file and cannot be read')

        return node.content

